import React, { Component } from 'react';
import Link from 'next/link'
class Index extends Component {
    state = {}
    render() {
        return (
            <div className='div'>
                <nav>
                    <ul>
                        <li>
                            <Link href='/login'>Login</Link>
                        </li>
                        <li>
                            <Link href='/login'>Login</Link>
                        </li>
                    </ul>
                </nav>
                <br />

                <style jsx>
                    {`
                        .div {
                            width: 100%;
                            height: 100vh;
                            display: flex;
                            align-items: center;
                            justify-content: center
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default Index;
